import "./style.css";
import Post from './records.json';

export default function DataFetching() {
    return (
    <div className="post">
        <ul>
        
            {JSON.parse(Post)?.map(post => (
                <li key={post.id}>
                    <h3>{post.title}</h3>
                </li>
            ))}

        </ul>

    </div>
    )
}
